import { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/UserDashboard.css';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import UserProfileCard from '../components/UserProfileCard';
import UserChaletsList from '../components/UserChaletsList';

function UserDashboard() {
  const navigate = useNavigate();
  const [userData, setUserData] = useState(null);
  const [userChalets, setUserChalets] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        // Get user data from localStorage
        const user = JSON.parse(localStorage.getItem('user'));
        if (!user) {
          navigate('/login');
          return;
        }
  
        // Fetch user's chalets
        const chaletsResponse = await fetch(
          `http://localhost/REAL_ESTATE_PROJECT/api/get_user_chalets.php?user_id=${user.userId}`, 
          { credentials: 'include' }
        );
        
        if (!chaletsResponse.ok) {
          throw new Error('Failed to fetch chalets');
        }
  
        const chaletsData = await chaletsResponse.json();
        
        if (chaletsData.success) {
          setUserChalets(chaletsData.chalets);
        } else {
          console.error('Error fetching chalets:', chaletsData.message);
        }
      } catch (error) {
        console.error('Error fetching user data:', error);
        navigate('/login');
      } finally {
        setLoading(false);
      }
    };
  
    fetchUserData();
  }, [navigate]);

  if (loading) {
    return <div className="loading-spinner">Loading...</div>;
  }

  return (
    <div className="user-dashboard-container">
      <Navbar />
      <div className="user-dashboard">
        <aside className="user-sidebar">
          <div className="sidebar-header">
            <h2 className="sidebar-title">
              <span className="gradient-text">My</span> Account
            </h2>
          </div>
          <nav className="sidebar-nav">
            <ul>
              <li>
                <a href="#dashboard" className="nav-link active">
                  <span className="nav-icon">üìä</span>
                  <span className="nav-text">Dashboard</span>
                </a>
              </li>
              <li>
                <a href="#properties" className="nav-link">
                  <span className="nav-icon">üè†</span>
                  <span className="nav-text">My Chalets</span>
                </a>
              </li>
              <li>
                <a href="#favorites" className="nav-link">
                  <span className="nav-icon">‚ù§Ô∏è</span>
                  <span className="nav-text">Favorites</span>
                </a>
              </li>
              <li>
                <a href="#settings" className="nav-link">
                  <span className="nav-icon">‚öôÔ∏è</span>
                  <span className="nav-text">Settings</span>
                </a>
              </li>
            </ul>
          </nav>
          <div className="sidebar-footer">
            <button 
              className="logout-btn"
              onClick={() => {
                // Add logout logic here
                navigate('/login');
              }}
            >
              <span className="nav-icon">üö™</span>
              <span className="nav-text">Logout</span>
            </button>
          </div>
        </aside>

        <main className="user-main">
          <header className="user-header">
            <div className="header-content">
              <h1 className="user-greeting">
                Welcome back, <span className="gradient-text">{userData?.name || 'User'}</span>
              </h1>
              <p className="user-date">
                {new Date().toLocaleDateString('en-US', { 
                  weekday: 'long', 
                  year: 'numeric', 
                  month: 'long', 
                  day: 'numeric' 
                })}
              </p>
            </div>
            <div className="user-actions">
              <button 
                className="action-btn primary"
                onClick={() => navigate('/add-chalet')}
              >
                <span className="btn-icon">‚ûï</span>
                <span className="btn-text">Add Chalet</span>
              </button>
            </div>
          </header>

          <div className="user-content">
            <section id="profile" className="dashboard-section">
              <div className="section-header">
                <h2 className="section-title">My Profile</h2>
                <p className="section-subtitle">Manage your account information</p>
              </div>
              <UserProfileCard userData={userData} />
            </section>

            <section id="properties" className="dashboard-section">
              <div className="section-header">
                <h2 className="section-title">My Chalets</h2>
                <p className="section-subtitle">Properties you own</p>
              </div>
              <UserChaletsList chalets={userChalets} />
            </section>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
}

export default UserDashboard;
